/*!50003 CREATE*/ /*!50017 DEFINER=`root`@`localhost`*/ /*!50003 TRIGGER `UpdateSubCostCartItemOnInsert` BEFORE INSERT ON `CartItem` FOR EACH ROW BEGIN
  SET @baseCost := (SELECT I.baseCost FROM Ingredient I WHERE I.id = NEW.id_Ingredient);
  SET NEW.subCost := @baseCost * NEW.multiplier;
