/*!50003 CREATE*/ /*!50017 DEFINER=`root`@`localhost`*/ /*!50003 TRIGGER `PreventUpdateOfCartItemIfIsCommand` BEFORE UPDATE ON `CartItem` FOR EACH ROW BEGIN
  SET @commandCountWithCartId := (SELECT COUNT(*) FROM Command C WHERE C.id_Cart = NEW.id_Cart);
  IF @commandCountWithCartId > 0 THEN
